import React from 'react'
import { Container, Row, Col } from 'reactstrap';
import './projects.'

const Projects = () => {
  return (
    <div className='projects' id='projects'>
      <Container>

      <h5>PORTFOLIO</h5>
      <h3>Each project is a unique piecce of development</h3>
      </Container>

    </div>
  )
}

export default Projects
